const require_utils = require('../../../common/utils.cjs');

//#region src/namespaces/geo/generate/utils.ts
const generateItemOrFeed = (geo) => {
	if (!require_utils.isObject(geo)) return;
	return require_utils.trimObject({
		"geo:lat": require_utils.generateNumber(geo.lat),
		"geo:long": require_utils.generateNumber(geo.long),
		"geo:alt": require_utils.generateNumber(geo.alt)
	});
};

//#endregion
exports.generateItemOrFeed = generateItemOrFeed;